svg.script:

const hospital_points = document.querySelectorAll('.hospital-point')
const hospital_names = document.querySelectorAll('.hospital-name')
const school_points = document.querySelectorAll('.school-point')
const school_names = document.querySelectorAll('.school-name')
const park_points = document.querySelectorAll('.park-point')
const park_names = document.querySelectorAll('.park-name')
const market_points = document.querySelectorAll('.market-point')
const market_names = document.querySelectorAll('.market-name')
const central_points = document.querySelectorAll('.central-point')
const central_names = document.querySelectorAll('.central-name')
const metros4_point = document.querySelectorAll('.metros4-point')
const metros4_name = document.querySelectorAll('.metros4-name')
const metrobt_point = document.querySelectorAll('.metrobt-point')
const metrobt_name = document.querySelectorAll('.metrobt-name')
const club_points = document.querySelectorAll('.club-point')
const club_names = document.querySelectorAll('.club-name')
const addZoomAnimation = (points, pointNames = []) => {
  points.forEach(point => {
    point.addEventListener('mouseenter', () => {
      points.forEach(p => p.classList.add('zoomed'))
      pointNames.forEach(p => p.classList.add('zoomed'))
    })
    point.addEventListener('mouseleave', () => {
      points.forEach(p => p.classList.remove('zoomed'))
      pointNames.forEach(p => p.classList.remove('zoomed'))
    })
  })
}
addZoomAnimation(hospital_points, hospital_names)
addZoomAnimation(school_points, school_names)
addZoomAnimation(park_points, park_names)
addZoomAnimation(market_points, market_names)
addZoomAnimation(central_points, central_names)
addZoomAnimation(metros4_point, metros4_name)
addZoomAnimation(metrobt_point, metrobt_name)
addZoomAnimation(club_points, club_names)
